import "../../../css/Admin/statistics.css";
import React, { useState, useEffect } from 'react';

export function Statistics() {

    const [users, setUsers] = useState([])

    useEffect(() => {
        fetch(`http://localhost:3001/consult`, {
            method: 'GET'
        })
            .then(response => response.json())
            .then(response => {
                setUsers(response)
                console.log(response)
            })
            .catch(error => console.error('Error:', error));
    }, []);

    return(
        <>
             <div className="title-box-crud">
                <h2>Estadísticas</h2>
            </div>
            <div className="estatistics-box">
                <div className="info-statistics">
                    <h3 className="txt-blue">Cantidad de reservas hasta hoy:</h3>
                    <h1 className="txt-black">1000</h1>
                </div>
                <div className="info-statistics">
                    <h3 className="txt-black">Cantidad de reservas de este mes:</h3>
                </div>
                <div className="info-statistics">
                    <h3 className="txt-black">Cantidad de usuarios activos:</h3>
                </div>
                <div className="info-statistics">
                    <h3 className="txt-black">Asesor con más reservas:</h3>
                </div>
            </div>
        </>
    )
}
